import Nav from "./Nav";
import Logo from "../assets/logo.svg";
import "../style/header.css";

function Header() {
	return (
		<>
          <header>
            <img src={Logo} alt="logo" />
            <div className="toggle"></div>
            <Nav/>
          </header>
		</>
	);
}

export default Header;
